import React, { Fragment } from 'react';
import { BrowserRouter as Router, Link, useLocation } from "react-router-dom";


  function useQuery() {
    return new URLSearchParams(useLocation().search);
  }

  const selection = useQuery().get("selection");

  
const Header = (sel) => {

    return(
    <Fragment>
        <div class="d-flex flex-row justify-content-center">
            <div class="p-2">
                <a class={'btn ' + ((`${selection}` === 'Applications') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">
                    Applications
                </a>
            </div>
            <div class="p-2"><a class={'btn ' + ((`${selection}` === 'Vendors') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">Vendors</a></div>
            <div class="p-2"><a class={'btn ' + ((`${selection}` === 'Other') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">Other</a></div>
        </div>
    </Fragment>);
};

export default Header;
